const Logo = ({ logo, logoButton, logoData }) => {
  return (
    <div className="logo">
      <img src={logo} width="150" height="75" alt="" />
      <div>{logoButton ? "nowe logo " + logoData : "logo " + logoData}</div>
    </div>
  );
};

export default Logo;
